script: |
  super -f text -I q2950.spq | sort > q2950.out

inputs:
  - name: q2950.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE 58 NOT IN ( - - col0, CAST ( - col0 AS INTEGER ), - col2, col2 * + col0 + - 53, - col1 + - col2, + 85 );
  - name: tab1

outputs:
  - name: q2950.out
    data: |
      51	14	96
      85	5	59
      91	47	68
